  },
  "url": "http://localhost:6060/hapi-fhir-jpaserver/fhir/ValueSet/2.16.840.1.113883.3.526.3.1520",
  "identifier": [
    {
      "system": "urn:ietf:rfc:3986",
      "value": "2.16.840.1.113883.3.526.3.1520"
    }
  ],
  "name": "Emergency Department Visit",
  "status": "active",
  "publisher": "American Medical Association-convened Physician Consortium for Performance Improvement(R)",
  "compose": {
    "include": [
      {
        "system": "2.16.840.1.113883.6.12",
        "version": "2019",
        "concept": [
          {
            "code": "99281",
            "display": "Emergency department visit for the evaluation and management of a patient, which requires these 3 key components: A problem focused history; A problem focused examination; and Straightforward medical decision making. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patient's and/or family's needs. Usually, the presenting problem(s) are self limited or minor."
          },
          {
            "code": "99282",
            "display": "Emergency department visit for the evaluation and management of a patient, which requires these 3 key components: An expanded problem focused history; An expanded problem focused examination; and Medical decision making of low complexity. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patient's and/or family's needs. Usually, the presenting problem(s) are of low to moderate severity."
          },
          {
            "code": "99283",
            "display": "Emergency department visit for the evaluation and management of a patient, which requires these 3 key components: An expanded problem focused history; An expanded problem focused examination; and Medical decision making of moderate complexity. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patient's and/or family's needs. Usually, the presenting problem(s) are of moderate severity."
          },
          {
            "code": "99284",
            "display": "Emergency department visit for the evaluation and management of a patient, which requires these 3 key components: A detailed history; A detailed examination; and Medical decision making of moderate complexity. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patient's and/or family's needs. Usually, the presenting problem(s) are of high severity, and require urgent evaluation by the physician, or other qualified health care professionals but do not pose an immediate significant threat to life or physiologic function."
          },
          {
            "code": "99285",
            "display": "Emergency department visit for the evaluation and management of a patient, which requires these 3 key components within the constraints imposed by the urgency of the patient's clinical condition and/or mental status: A comprehensive history; A comprehensive examination; and Medical decision making of high complexity. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patient's and/or family's needs. Usually, the presenting problem(s) are of high severity and pose an immediate significant threat to life or physiologic function."
          }
        ]
      },
      {
        "system": "2.16.840.1.113883.6.96",
        "version": "2019-09",
        "concept": [
          {
            "code": "4525004",
            "display": "Emergency department patient visit (procedure)"
          }
        ]
      }
    ]
  }
}

